#[derive(Clone, Copy)]
enum TestEnum<T> {
    A,
    B(T),
    C(T, T),
    D { x: T, y: T },
}

#[repr(C)]
union TestUnion<T>
where
    T: Copy,
{
    a: T,
    b: T,
}

struct TestStruct<T>
where
    T: Copy,
{
    x: T,
    e: TestEnum<T>,
    o: Option<T>,
    u: TestUnion<T>,
}

impl<T> TestStruct<T>
where
    T: Copy,
{
    fn new(t: T) -> Self {
        Self {
            x: t,
            e: TestEnum::B(t),
            o: Some(t),
            u: TestUnion { a: t },
        }
    }
}

impl<T> Test for TestStruct<T>
where
    T: Test + Copy,
{
    fn modify(&mut self) {
        self.x.modify()
    }
}

impl<T> Test for TestEnum<T>
where
    T: Test + Copy,
{
    fn modify(&mut self) {
        match *self {
            Self::B(mut b) => {
                b.modify();
                *self = Self::B(b);
            }
            Self::C(mut c1, mut c2) => {
                c1.modify();
                c2.modify();
                *self = Self::C(c1, c2);
            }
            Self::D { mut x, mut y } => {
                x.modify();
                y.modify();
                *self = Self::D { x, y };
            }
            _ => {}
        }
    }
}

#[inline(never)]
fn test_args_1<T: Test>(mut t: T) {
    t.modify();
}

#[inline(never)]
fn test_args_2<T: Test, U: Test>(mut t: T, mut u: U) {
    t.modify();
}

#[inline(never)]
fn test_args_3<T: Test, U: Test, V: Test>(mut t: T, mut u: U, mut v: V) {
    t.modify();
}

#[inline(never)]
fn test_args_4<T: Test, U: Test, V: Test, W: Test>(mut t: T, mut u: U, mut v: V, mut w: W) {
    t.modify();
}

#[inline(never)]
fn test_args_5<T: Test, U: Test, V: Test, W: Test, X: Test>(
    mut t: T,
    mut u: U,
    mut v: V,
    mut w: W,
    mut x: X,
) {
    t.modify();
}

#[inline(never)]
fn test_args_6<T: Test, U: Test, V: Test, W: Test, X: Test, Y: Test>(
    mut t: T,
    mut u: U,
    mut v: V,
    mut w: W,
    mut x: X,
    mut Y: Y,
) {
    t.modify();
}

